import React from 'react'
import Slider from "react-slick";

function MovieSlider() {
    return (
        <div class="slider">
            <Slider class="single-item">
                <img src="http://placehold.it/350x250?text=1" />
                <img src="http://placehold.it/350x250?text=2" />
                <img src="http://placehold.it/350x250?text=3" />
            </Slider>
        </div>
    )
}

export default MovieSlider
